import { services } from '../../assets/dummy.js' 
import { MdEdit, MdDelete, MdAdd } from 'react-icons/md'

export const AdminDashboard = () => {
  return (
    <div className="flex flex-col items-center justify-center gap-8 h-full w-full py-20 p-10 scroll-auto bg-red-500">

    <div title="Add a service" className="border-4 border-white hover:border-2 fixed bottom-5 right-0 left-0 md:left-[90%] lg:left-[95%] ml-auto mr-auto md:mr-0 md:ml-0 md:right-5 bg-black text-white w-10 h-10 flex justify-center items-center cursor-pointer border-transparent rounded-full">
      <MdAdd />
    </div>

        {services.map(service => (
        <div className="bg-black w-full rounded-lg h-20 text-white flex justify-center items-center text-xs md:text-sm max-w-md relative">
          {service.title}

          <div title="Delete a service" className="absolute -right-5 border-4 border-white hover:border-2 hover:border-red-500 hover:text-red-500 bg-black text-white w-10 h-10 flex justify-center items-center cursor-pointer border-transparent rounded-full">
      <MdDelete />
    </div>

          <div title="Edit a service" className="absolute -left-5 border-4 border-white hover:border-2 hover:border-green-500 hover:text-green-500 bg-black text-white w-10 h-10 flex justify-center items-center cursor-pointer border-transparent rounded-full">
      <MdEdit />
    </div>
        </div>
        ))}
  </div>
  )
}
